    setDashboardContent("<h2>Adios</h2>");
  };
  const todayConsults = () => {
    setDashboardContent("<h2>Adios</h2>");
  };
  const addService = () => {
    setDashboardContent("<h2>Adios</h2>");
  };
  const editService = () => {
    setDashboardContent("<h2>Adios</h2>");
  };
  return (
    <>
      <Row style={{ height: "90vh" }}>
